  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1955.
  The report begins by summarizing the weather conditions, water conditions, and wildfires
  during this period. Wildlife- including migratory birds, big game animals, furbearers,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments and prescribed fires. Resource management is outlined;
  topics include timber removal. The public relations section of the report describes
  Refuge visitors. N-R forms and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
